import { ChatApp } from './components/chatapp/chatbox'
import {
    BrowserRouter,
    Router,
    Switch,
    Route,
    Link,
  } from "react-router-dom";
import './app.css'
function App() {
    return (
        // <ChatApp></ChatApp>
        <BrowserRouter>
           <Route path = "/" component = {ChatApp} />
           <Route path = "/login" component = {<h1>Hello</h1>} />
        </BrowserRouter>
       
    )
}

export {App}
